function handleNavMenuClickOnMobile(){var e=document.querySelector(".nav-burger-menu img");let t=document.querySelector(".nav-items"),c=document.querySelector(".app-navbar"),a=document.querySelector(".docs-nav");e.addEventListener("click",()=>{t?.classList.toggle("active"),c?.classList.toggle("active"),a?.classList.toggle("active")}),document.addEventListener("click",function(e){e.target.closest(".app-navbar")||e.target.closest(".docs-nav")||(t?.classList.remove("active"),c?.classList.remove("active"),a?.classList.remove("active"))})}async function copyTextToClipboard(e){try{return await navigator.clipboard.writeText(e),!0}catch(e){return console.error("Failed to copy: ",e),!1}}handleNavMenuClickOnMobile();